import React from "react";

import { FormControl,InputGroup, Row, Col } from "react-bootstrap";

import "./formCard.css";

import logo1 from "../../../Images/assets/LUSD.png";
import logo2 from "../../../Images/assets/Dai_Logo1.png";

const formCard = () => {
  return (
    <div className=" formCard-card-container">
      <div className="formCard-card-wrapper">
        <div className="formCard_card_module">
          <div className="formCard_custom_col">
            <img className="img_css" src={logo2} alt="DAI"></img>
            <h2 className="formCard_custom_h2">0.00 DAI</h2>
          </div>
          <div className="formCard_custom_col">
            <img className="img_css" src={logo1} alt="LUSD"></img>
            <h2 className="formCard_custom_h2">0.00 LSD</h2>
          </div>
          Unlocked DAI:
          <hr className="" />
          <hr className="" />
          <hr className="" />
          <hr className="" />
          <InputGroup className="mb-3">
            <FormControl
              placeholder="Username"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
            <InputGroup.Prepend>
              <InputGroup.Text id="basic-addon2">@</InputGroup.Text>
            </InputGroup.Prepend>
          </InputGroup>
        </div>
      </div>
    </div>
  );
};  
export default formCard;
